function App() {
  const [incentives, setincentives] = useState([]);
  useEffect(() => {
     fetch('http://127.0.0.1:8000/heroes/', {
      method: 'GET',
      headers: {
        'Content-Type': 'application/json'
      }
     })
        .then(resp => resp.json())
        .then(resp => setincentives(resp))
        .catch(error => console.log(error));
  }, []);

return (
  <Incentives incentives={incentives}/>
);
};

export default App;
